package com.dosideas.videojuegos.service;

import com.dosideas.videojuegos.domain.Videojuego;
import java.util.ArrayList;
import java.util.List;
import org.springframework.stereotype.Service;

@Service
public class VideojuegoService {
    public List<Videojuego>buscarDestacados(){
        List<Videojuego>destacados = new ArrayList<>();
        
        Videojuego juego = new Videojuego();
        juego.setNombre("Aladdín");
        juego.setDescripcion("Aladdin es un ladronzuelo que se enamora de la hija del Sultán, la princesa Jasmine. Para poder conquistarla aceptará un desafío de Jafar. Aladdín tendrá que entrar en una cueva en mitad del desierto y conseguir una lámpara mágica que contiene al Genio que será el encargado de concederle todos sus deseos.");
        juego.setImagenUrl("data:image/jpeg;base64,");
        destacados.add(juego);
        
        juego = new Videojuego();
        juego.setNombre("Contra");
        juego.setDescripcion("Contra es una serie de videojuegos creada por la compañía japonesa Konami en 1987, cuyos primeros títulos recibieron el nombre de Probotector en Europa. Son fundamentalmente shoot 'em ups de tipo run and gun y están inspirados en películas como Rambo o Alien");
        juego.setImagenUrl("data:image/png;base64,");
        destacados.add(juego);
        
        juego = new Videojuego();
        juego.setNombre("Pitfall");
        juego.setDescripcion("Pitfall! es un videojuego de scroll horizontal, en el cual el protagonista debe salir de un bosque peligroso, esquivando serpientes, saltando cocodrilos y troncos que amenazan con aplastarlo");
        juego.setImagenUrl("data:image/jpeg;base64,");
        destacados.add(juego);
        
        juego = new Videojuego();
        juego.setNombre("Looney Toons");
        juego.setDescripcion("Looney Tunes es una serie de dibujos animados de la compañía Warner Bros que comenzó su andadura oficialmente en 1930 con el cortometraje Sinkin' in the Bathtub. A los personajes de dibujos animados más famosos de la Warner a veces se les llama también Looney Toons, sobre todo en conjunto");
        juego.setImagenUrl("data:image/jpeg;base64,");
        destacados.add(juego);
        
        return destacados;
    }
}
